import React from "react";
import PropTypes from "prop-types";

function Food({num, name, rating}){
  return (
  <div>
    <h2>{num}. I like {name}</h2>
    <h4>{rating}/5</h4>
  </div>
  );
}

Food.propTypes = {
  name: PropTypes.string.isRequired,
  id: PropTypes.number.isRequired,
  rating: PropTypes.number
}

const foodLike = [
  {
    name : "kimchi",
    id : 1,
    rating: 5
  },
  {
    name : "banana",
    id : 2,
    rating: 4.9
  }
];

function renderFood(dish){
  return (
  <Food 
    key={dish.id}
    num={dish.id}
    name={dish.name}
    rating={dish.rating}
  />
  );
}

function App() {
  return (
  <div>
    <h1>Hi!</h1>
    {foodLike.map(renderFood)}
  </div>
  );
}

export default App;
